  return (
    <div className="fieldArea">
      <div className="fieldPlayerss">

        {fieldPlayers.map((item, index) => {
          return (
            <>

              <div className={"fieldPlayer" + index}>
                <div className="pictureXbutton">
                  <button>x</button>
                </div>
                <div className="fieldPictureArea">
                  <img src={item.image}></img>
                </div>
              </div>

            </>
          )
        })}

      </div>
    </div>
  );
}

